import React from 'react';

const FeedbackPage = () => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h2>Submit Feedback</h2>
            <form>
                <textarea placeholder="Write your feedback here..." style={{ width: '300px', height: '100px', margin: '10px' }}></textarea><br />
                <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#004085', color: '#fff' }}>Submit</button>
            </form>
        </div>
    );
};

export default FeedbackPage;
